import { useState } from 'react';

function Chat2(){
    const [count, setCount] = useState(10);

    function increment(){
        setCount(count + 1);
        
    }

    return(
        <div>
            <input type="button" value="+" onClick={increment}/>
            <input type="button" value="-"/>
            { count }
        </div>
    )
}

export default Chat2;
